import { Statistic, Card, Row, Col } from "antd";
import "../CustomCSS.css";
function StatisticsBoxes() {
  return (
    <div className="site-statistic-demo-card">
      <Row gutter={25}>
        <Col span={6}>
          <Card bodyStyle={{ background: "#1F1E26" }}>
            <Statistic
              title="Total Devices"
              value={12}
              valueStyle={{ color: "white", fontWeight: "bold" }}
            />
          </Card>
        </Col>
        <Col span={6}>
          <Card bodyStyle={{ background: "#1F1E26" }}>
            <Statistic
              title="Online"
              value={9}
              valueStyle={{ color: "#45D5C9", fontWeight: "bold" }}
            />
          </Card>
        </Col>
        <Col span={6}>
          <Card bodyStyle={{ background: "#1F1E26" }}>
            <Statistic
              title="Inactive"
              value={2}
              valueStyle={{ color: "#FFC130", fontWeight: "bold" }}
            />
          </Card>
        </Col>
        <Col span={6}>
          <Card bodyStyle={{ background: "#1F1E26" }}>
            <Statistic
              title="Offline"
              value={1}
              valueStyle={{ color: "#FA816E", fontWeight: "bold" }}
            />
          </Card>
        </Col>
      </Row>
    </div>
  );
}

export default StatisticsBoxes;
